import React from "react";

const SearchBar = props => {
  retrun(
    <form onSubmit={props.handleSubmit}>
      <p>
        <input
          type="text"
          placeholder="Serach GIF..."
          onChange={props.handleInputChange}
          name="searchInput"
        />
      </p>
    </form>
  );
};

export default SearchBar;
